package com.sc.coding.FirestoreTest

import com.fasterxml.jackson.module.kotlin.jacksonObjectMapper
import com.fasterxml.jackson.module.kotlin.readValue
import com.sc.coding.model.request.InsertImage
import com.sc.coding.model.response.Response
import com.sc.coding.module
import io.ktor.http.*
import io.ktor.server.testing.*
import junit.framework.Assert.assertEquals
import org.junit.Test

class FireStoreRouteTest {

    @Test
    fun testInsertImage() {
        withTestApplication({ module(testing = true) }) {
            handleRequest(HttpMethod.Post, "/api/v1/fireStore/add") {
                addHeader(HttpHeaders.ContentType, ContentType.Application.Json.toString())
                val param = InsertImage(
                    email = "tes@tes.com",
                    seq = "1",
                    imageBase64 = ""
                )
                val mapper = jacksonObjectMapper()
                val json = mapper.writeValueAsString(param)
                setBody(json)
            }.apply {
                assertEquals(HttpStatusCode.OK, response.status())
                val resultString = response.content.toString()
                val mapper = jacksonObjectMapper()
                val resp: Response = mapper.readValue(resultString)
                assertEquals(200, resp.code)
                assertEquals("Success", resp.status)
            }
        }
    }

}